import React from "react";
import Link from "next/link";

import * as Styled from "./style";
import List, { ListDirection } from "../../molecules/List";
import ListItem from "../../molecules/ListItem";

const menuItems = [
  {
    id: 1,
    type: "favorite",
    content: "즐겨찾는 게시판",
  },
  {
    id: 2,
    type: "general",
    content: "전체 글보기",
  },
  {
    id: 3,
    type: "class",
    content: "필수사항",
  },
  {
    id: 4,
    type: "general",
    content: "공지사항",
  },
  {
    id: 5,
    type: "general",
    content: "가입인사",
  },
  {
    id: 6,
    type: "class",
    content: "스터디",
  },
  ,
  {
    id: 7,
    type: "general",
    content: "웹 스터디",
  },
  ,
  {
    id: 8,
    type: "general",
    content: "알고리즘 스터디",
  },
];

const ClubMenu = () => {
  let renderMenuList = (menuData) =>
    menuData.map((data) => (
      <ListItem>
        {data.type === "favorite" && <Styled.FavoriteIcon />}
        {data.type === "general" && <Styled.ArrowIcon />}
        {data.type === "class" && "# "}
        {data.type === "general" ? (
          <Link href={`/BoardPage/board?id=${data.id}`}>
            <a>{data.content}</a>
          </Link>
        ) : (
          <>{data.content}</>
        )}
      </ListItem>
    ));

  return (
    <List card={true} direction={ListDirection.col} width="100%">
      {renderMenuList(menuItems)}
    </List>
  );
};

export default ClubMenu;
